import { useHistory } from 'react-router-dom';

function Navbar({userEmail, buttonText}) {

  const history = useHistory();
  const goLogin = () => {
    history.push("/login");
  }

  const handleClick = () => {
    goLogin();
  }

  return (
    <nav className="menu">
      <span className="menu__user-email">{userEmail}</span>
      <button className="menu__nav-button button" onClick={handleClick}>{buttonText}</button>
    </nav>
  );
}

export default Navbar;
